import React from "react";

import closeimg from "../images/06.Contacto/x.png";

require("typeface-poppins");
require("typeface-rubik");
function ContactModal() {
  return (
    <div className="flex justify-center items-center ">
      <div className="w-263.75 h-148.5 bg-blue-250">
        <div className="flex w-263.75 justify-end items-end">
          <button className="rounded-md p-4 inline-flex justify-end items-end hover:text-gray-500 hover:bg-blue-300 focus:outline-none focus:shadow-lg">
            <img className="" src={closeimg} alt="" />
          </button>
        </div>

        <div className="flex">
          <div>
            <div className="h-1 bg-blue-850 mx-0 mt-2 w-72"></div>
            <h1 className="text-left font-extrabold font-poppins text-6xl text-blue-850">
              Contacto
            </h1>
            <div className="h-1 bg-blue-850 mx-0 w-72 "></div>
          </div>
        </div>






      </div>
    </div>
  );
}
export default ContactModal;
